import React from 'react';
import './Home.css';
import Footer from './Footer'
import NavBar from './NavBar'

import { useNavigate } from 'react-router-dom';

const Home = () => {
  const navigate = useNavigate();
      return (
          <div>
              {/* <nav class = "navbar background">
                  <ul class = "nav-list">
                      <div class = "logo"> 
                          <img src = "https://pisces.bbystatic.com/image2/BestBuy_US/images/products/9023/9023969_sa.jpg;maxHeight=640;maxWidth=550"
                          alt = "Logo lmafoasdof" />
                      </div>
                      <li><button onClick = "#Login" id = "button"> Login lol</button></li>
                      <li><button onClick = "#Home" id = "button"> Home lol</button></li>
                      <li><button onClick = "#Calculate" id = "button"> Calculate lol</button></li>
                      <li><button onClick = "#Contact Us" id = "button"> Contact lol</button></li>
                  </ul>
                </nav> */}

                {/* The section below is for the body of the homepage */}
                <html>
                  <head>
                    <title>Financial Calculadora</title>
                    <link rel="stylesheet" href="styles/styles.css" />
                    <script async src="./javascript/index.js"></script>
                  </head>
                  <body>
                    <h1>This is a Financial Calculator for calculating different things</h1>
                    <h4 id='date'></h4>

                    <div class="image-section">
                      <div class="section-style">
                        <img src="https://www.google.com/url?sa=i&url=https%3A%2F%2Fwww.pixtastock.com%2Fillustration%2F47504268&psig=AOvVaw26rHy1ziDlF9W8S4wpmVuI&ust=1676052810584000&source=images&cd=vfe&ved=0CA8QjRxqFwoTCLDC_rSFif0CFQAAAAAdAAAAABAJ" alt="" />
                        <p>Sample Picture 1</p>
                      </div>

                      <div class="section-style">
                        <img src="https://www.google.com/url?sa=i&url=https%3A%2F%2Ffreeicons.io%2Ffree-logos%2Fdistribution-give-giving-product-sample-sampling-icon-76741&psig=AOvVaw3wzZ6GRu_QiY7L6s9Ctk_J&ust=1676050988419000&source=images&cd=vfe&ved=0CA8QjRxqFwoTCMDChtD-iP0CFQAAAAAdAAAAABAM" alt="" />
                        <p>Sample Picture 2</p>
                      </div>
                    </div>

                    <div class="image-section">
                      <div class="section-style">
                        <img src="https://www.google.com/url?sa=i&url=https%3A%2F%2Fwww.unum.bio%2Fsamples&psig=AOvVaw3wzZ6GRu_QiY7L6s9Ctk_J&ust=1676050988419000&source=images&cd=vfe&ved=0CA8QjRxqFwoTCMDChtD-iP0CFQAAAAAdAAAAABBE" alt="" />
                        <p>Sample Picture 3</p>
                      </div>

                      <div class="section-style">
                        <img src="https://www.google.com/url?sa=i&url=https%3A%2F%2Fpmssec.dpm.psc.gov%2Fj%2Fapex_ui%2Fimg%2Ficons%2Fpkg-apps%2F&psig=AOvVaw3wzZ6GRu_QiY7L6s9Ctk_J&ust=1676050988419000&source=images&cd=vfe&ved=0CA8QjRxqFwoTCMDChtD-iP0CFQAAAAAdAAAAABA8" alt="" />
                        <p>Sample Picture 4</p>
                      </div>
                    </div>
                    
                    <div class="image-section">
                      <div class="section-style">
                        <img src="https://www.google.com/url?sa=i&url=https%3A%2F%2Ficonscout.com%2Ficon%2Fsample-1839110&psig=AOvVaw3wzZ6GRu_QiY7L6s9Ctk_J&ust=1676050988419000&source=images&cd=vfe&ved=0CA8QjRxqFwoTCMDChtD-iP0CFQAAAAAdAAAAABA0" alt="" />
                        <p>Sample Picture 5</p>
                      </div>

                      <div class="section-style">
                        <img src="https://www.google.com/url?sa=i&url=https%3A%2F%2Ftwitter.com%2Fsamplefocus&psig=AOvVaw3wzZ6GRu_QiY7L6s9Ctk_J&ust=1676050988419000&source=images&cd=vfe&ved=0CA8QjRxqFwoTCMDChtD-iP0CFQAAAAAdAAAAABAk" alt="" />
                        <p>Sample Picture 6</p>
                      </div>
                    </div>

                    <div class="image-section">
                      <div class="section-style">
                        <img src="https://www.google.com/url?sa=i&url=https%3A%2F%2Fwww.reddit.com%2Fr%2FYoushouldsamplethis%2F&psig=AOvVaw3wzZ6GRu_QiY7L6s9Ctk_J&ust=1676050988419000&source=images&cd=vfe&ved=0CA8QjRxqFwoTCMDChtD-iP0CFQAAAAAdAAAAABAc" alt="" />
                        <p>Sample Picture 7</p>
                      </div>

                      <div class="section-style">
                        <img src="https://www.google.com/url?sa=i&url=https%3A%2F%2Ficonarchive.com%2Fshow%2Fcryonic-folder-icons-by-3xhumed%2FFolder-Blank-sample-icon.html&psig=AOvVaw3wzZ6GRu_QiY7L6s9Ctk_J&ust=1676050988419000&source=images&cd=vfe&ved=0CA8QjRxqFwoTCMDChtD-iP0CFQAAAAAdAAAAABAU" alt="" />
                        <p>Sample Picture 8</p>
                      </div>
                    </div>
                  </body>
                </html>
          </div>
    );
    <Footer />
  }

  export default Home;

